	TempKeys
)

INSERT INTO _NewKeys (ID, lcKW, KeyParent)
SELECT
	row_number() over (order by lcKW) AS ID
	,*
FROM
	UniqueLower
order by id
;

insert into AgLibraryKeyword (id_local,lc_name,name,genealogy,parent,id_global,dateCreated,imageCountCache,includeOnExport,includeParents,includeSynonyms,keywordType,lastApplied)
SELECT
	--CAST((SELECT Val FROM _Variables WHERE Name='MaxKW') AS INTEGER) + (row_number() OVER (ORDER BY KW)) AS NewID
	(SELECT IDList FROM _NewKW WHERE IDSeq=ID) AS NewID
	,lower(lcKW) as NewLCName
	,lcKW as NewName
	,(select genealogy from AgLibraryKeyword where lc_name=lower(KeyParent))||'/7'||CAST((SELECT IDList FROM _NewKW WHERE IDSeq=ID) AS TEXT) AS NewGen
	,(select id_local from AgLibraryKeyword where lc_name=lower(KeyParent)) AS NewParent
	,hex( randomblob(4)) || '-' || hex( randomblob(2))
             || '-' || '4' || substr( hex( randomblob(2)), 2) || '-'
             || substr('AB89', 1 + (abs(random()) % 4) , 1)  ||
             substr(hex(randomblob(2)), 2) || '-' || hex(randomblob(6)) AS NewGlobal
	, strftime('%s','now') - strftime('%s','2001-01-01') as NewCreate
	,NULL as NewCache,0 as NewExport,0 as NewParents,0 as NewSyn,NULL as NewType,NULL as NewApplied

FROM
	_NewKeys
order by NewGen
	;
DELETE * FROM _NewKW WHERE IDSeq<=(SELECT count(*) FROM _NewKeys);